import { useEffect, useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import Header from '../components/Header';
import Footer from '../components/Footer';

export default function HasilPositif() {
  const location = useLocation();
  const navigate = useNavigate();

  const {
    nama = 'Nama Tidak Diketahui',
    hasil = 'Positif',
    probabilitas = 0.0,
    identitas,
    gejala,
    tanggal,
  } = location.state || {};

  const [isSubmitted, setIsSubmitted] = useState(false);

  const tanggalScreening = tanggal || new Date().toISOString();
  const tanggalFormatted = new Date(tanggalScreening).toLocaleDateString('id-ID', {
    day: '2-digit',
    month: 'long',
    year: 'numeric',
  });

  useEffect(() => {
    const simpanData = async () => {
      if (isSubmitted || !identitas || !gejala) return;

      const userRaw = localStorage.getItem('user');
      const user = JSON.parse(userRaw);

      if (!user || !user.user_id) {
        alert('Anda belum login. Silakan login terlebih dahulu.');
        navigate('/login');
        return;
      }

      try {
        const response = await fetch('http://localhost:5000/submit-screening', {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify({
            user_id: parseInt(user.user_id),
            nama_pasien: identitas.nama,
            nik: identitas.nik,
            jenis_kelamin: identitas.jenisKelamin,
            no_hp: identitas.telepon,
            usia: identitas.usia,
            alamat: identitas.alamat,
            hasil: hasil,
            catatan: '',
            probabilitas: parseFloat(probabilitas),
            gejala,
          }),
        });

        if (!response.ok) throw new Error('Gagal menyimpan data ke backend.');

        console.log('âœ… Data screening berhasil disimpan.');
        setIsSubmitted(true);
      } catch (error) {
        console.error('ðŸ”¥ Gagal menyimpan data:', error);
      }
    };

    simpanData();
  }, [isSubmitted, identitas, gejala, hasil, probabilitas, navigate]);

  const handleHubungiKami = () => {
    const nomorWA = '6281274489306';
    const pesan = 'Halo, saya ingin konsultasi mengenai hasil screening TBC saya.';
    const url = `https://wa.me/${nomorWA}?text=${encodeURIComponent(pesan)}`;
    window.open(url, '_blank');
  };

  const handleKembali = () => {
    navigate('/mainmenu');
  };

  return (
    <div className="d-flex flex-column min-vh-100">
      <Header />

      <div className="container my-5 flex-grow-1 text-center">
        <h2 className="fw-bold text-danger">SCREENING TBC</h2>
        <p className="text-muted">
          Segera periksa diri Anda ke fasilitas kesehatan terdekat. TBC bisa disembuhkan!
        </p>

        <div
          className="card mx-auto p-4"
          style={{ maxWidth: '500px', backgroundColor: '#ffebee' }}
        >
          <img
            src="/assets/images/Sakit.png"
            alt="Sakit"
            className="img-fluid mb-3"
            style={{ maxWidth: 140 }}
          />

          <div className="bg-white shadow-sm rounded p-3 mb-3">
            <h5 className="mb-1 fw-bold">{nama}</h5>
            <small className="text-muted">{tanggalFormatted}</small>
          </div>

          <h5 className="text-danger fw-bold mb-2">Anda Terduga TBC</h5>
          <p className="mb-0">
            Probabilitas: {(parseFloat(probabilitas) * 100).toFixed(2)}%
          </p>
        </div>

        <p className="mt-4 text-muted">
          Segera kunjungi Puskesmas atau fasilitas kesehatan terdekat untuk pemeriksaan lebih lanjut.
        </p>

        <div className="d-grid gap-3 mt-4 col-10 col-md-6 mx-auto">
          <button className="btn btn-success" onClick={handleHubungiKami}>
            Hubungi Kami
          </button>
          <button className="btn btn-outline-secondary" onClick={handleKembali}>
            Kembali ke Halaman Awal
          </button>
        </div>
      </div>

      <Footer />
    </div>
  );
}
